import React from 'react';
import styles from './Settings.module.css';
import Header from '/ui/header/Header';

const Settings = () => {
    const handleClearCache = () => {
        console.log('Clear cache');
    };

    const handleChangeTheme = () => {
        console.log('Change theme');
    };

    const handleGetAuthorization = () => {
        console.log('Get authorization');
    };

    return (
        <section className={styles.settingsSection}>
            <table className={styles.settingsTable}>
                <tbody>
                    <tr>
                        <td>
                            <label htmlFor="clearCache" className={styles.label}>Cache</label>
                        </td>
                        <td>
                            {/* Use the Button component */}
                            <Button path="/clear-cache" onClick={handleClearCache}>Clear Cache</Button>
                        </td>
                    </tr>
                    <tr>
                        <td>
                            <label htmlFor="themeSwap" className={styles.label}>Theme</label>
                        </td>
                        <td>
                            <Button path="/change-theme" onClick={handleChangeTheme}>Change Theme</Button>
                        </td>
                    </tr>
                    <tr>
                        <td>
                            <label htmlFor="getAuth" className={styles.label}>Auth</label>
                        </td>
                        <td>
                            <Button path="/get-authorization" onClick={handleGetAuthorization}>Get Authorization</Button>
                        </td>
                    </tr>
                </tbody>
            </table>
        </section>
    );
};

export default Settings;
